public class ProductOfAllOtherNumbers {
    public static int[] getProductsOfAllIntsExceptAtIndex(int[] intArray) {

        // make an array with the products
        int[] productArray = new int[intArray.length];

        // for each integer, find the product of all the integers
        // before it, storing the total product so far each time
        int productSoFar = 1;
        for (int i = 0; i < intArray.length; i++) {
            productArray[i] = productSoFar;
            productSoFar *= intArray[i];
        }

        // for each integer, find the product of all the integers
        // after it. since each index in products already has the
        // product of all the integers before it, now we're storing
        // the total product of all other integers
        productSoFar = 1;
        for (int i = intArray.length - 1; i >= 0; i--) {
            productArray[i] *= productSoFar;
            productSoFar *= intArray[i];
        }

        return productArray;
    }

    public static void main(String[] args) {
        int[] input = {1, 7, 3, 4};
        int[] output = getProductsOfAllIntsExceptAtIndex(input);
        for (int i = 0; i < output.length; i++) {
            System.out.println(output[i]);
        }
    }
}

